INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('42514686-6756-48c8-92e7-1a93e116171f', 'BergTop VC', 'We are a VC fund backed by global business angels. We invest at seed-stage and Series A in rapidly scalable startups with a focus on international markets. We''re hands-on and committed to helping our founders grow. Our investments help them maximize their potential. Most companies we invest in are "pre-series A," which means they''ve already raised some money, have some traction, and they understand what they need to grow. We have a strong bias in favor of B2B and B2B2C companies, we look at financial models, and we care about unit economics. We actively help with future fundraising rounds, marketing, sales, and management with a combination of structured mentorship.', 'https://bergtop.vc', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/bergtopvc', '2025-12-25T17:37:11.212Z', 'com_e033daab-f530-4fab-9419-f6682b2bad79', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:12.133Z', 'folk', '2025-12-25T17:37:11.212Z', 'Luxembourg', 'Advertising, B2B, E-Commerce, EdTech, FinTech, InsurTech, Marketing Automation, Messaging, Productivity Tools, SaaS', '["apply@bergtop.vc"]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["https://bergtop.vc"]'::jsonb, '{"Title":null,"Rounds":"Pre-Seed, Seed, Series A","Status":null,"Country":"Luxembourg","Fund HQ":null,"VC Logo":null,"Website":"https://bergtop.vc","Linkedin":"https://www.linkedin.com/company/bergtopvc","Country 1":"Luxembourg","Country 2":null,"Last Name":null,"First Name":null,"HQ Location":"Luxembourg","Funding Stage":"Pre-Seed / See